import React, { useState } from "react";
import {
  AppBar,
  Typography,
  Toolbar,
  Box,
  Button,
  Tabs,
  Tab,
} from "@mui/material";
import { Link } from "react-router-dom";
import { useStyles } from "./utils";
const Header = () => {
  const classes = useStyles();

  return (
    <AppBar
      position="sticky"
      sx={{
        background:"rgb(56,85,41)"
      }}
    >
      <Toolbar>
        <Typography className={classes.font} variant="h4" sty>
          APT
        </Typography>
        <Box display="flex" marginLeft={"auto"} >
            <Button style={{ color:"rgb(161,107,21)",fontSize:"16px"}} sx={{ margin: 1, borderRadius: 10 }}>Sign up</Button>
            <Button style={{ color:"rgb(161,107,21)",fontSize:"16px"}} sx={{ margin: 1, borderRadius: 10 }}>Login</Button>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
